import React, { Component } from 'react'

class NavButton extends Component {
    render() {

        const style = {
            textAlign: 'center'
        }

        return (
            <div>
                <button style={style} onClick={() => this.props.handlePageChange(this.props.name)}>{this.props.name}</button>
            </div>
        )
    }

}

export default NavButton;
